import './Styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// TO DO: list out all stocks a user owns
// List of dictionaries, this list needs to come from django backend
const stocks = [
    {
    id: 1,
    title: "MSFT",
    quantity: 5,
    costBasis: 250.64,
    },
    {
    id: 2,
    title: "AAPL",
    quantity: 7,
    costBasis: 121.45,
    },     
    {
    id: 3,
    title: "VTI",
    quantity: 10,
    costBasis: 203.64,
    }
    ];
// Lamda Function
const stocksItems = stocks.map((stock) =>
  <li class="list-group-item">{stock["title"]}, {stock["quantity"]}, {stock["costBasis"]}</li>
);

function PortfolioBody()
{
  return (
    <div className="Portfolio">
      <body className="Portfolio-body">
      <ul class="list-group">{stocksItems}</ul>
      </body>
    </div>
  );
}

export default PortfolioBody;
